Jazy Berlin - Like Biker Brother, Like Blackmailing Sister

Added: July 07, 2010

Jazy is looking to join her brother's biker gang, but to do so, she has to do him a favor. Her brother asks her to sleep with, Keiran, a rival gang member, so he has an excuse to take him out. Jazy accepts the deal and will do whatever it takes to succeed in her mission.
